import React, { Component } from 'react';

class FitnessFilters extends Component {
	render() {
		return (
			<div>
				<input onChange={handleOnChange} type="checkbox" />Cardio
				<input type="checkbox" />Yoga
				<input type="checkbox" />Pilates
			</div>
		);
	}
}

export default FitnessFilters
